webpackJsonp([0xf697f43f4e67],{5680:function(e,a){e.exports={data:{post:{html:'<p>NY Times: <a href="http://www.nytimes.com/2002/08/06/international/europe/06GERM.html?ex=1029297600&amp;en=ed57c9f323153bdb&amp;ei=5040&amp;partner=MOREOVER">Trailing in Polls, German Leader Tries Early Start in Race</a>.  And he\'s brought up Iraq as a campaign issue, with some latent anti-Americanism to boot.  "We are ready for solidarity, but this land will not be prepared for adventures... I\'m not for playing around with war or military action." He\'s calling this the "German way". No more European way? I seem to remember the last time Germany went its own way, it prematurely recognized the statehood of Croatia and accelerated the breakdown and chaos in Yugoslavia.</p>',fields:{title:"The German Way?",date:"07 Aug 2002",url:"https://papascott.de/2002-08-07-the-german-way/"}}},pathContext:{slug:"/2002-08-07-the-german-way/",prev:{fields:{title:"20% Of Doctor Bills Are Wrong",date:"07 Aug 2002",slug:"/2002-08-07-20-of-doctor-bills-are-wrong/"}},next:{fields:{title:"Barcode",date:"09 Aug 2002",slug:"/2002-08-09-barcode/"}}}}}});
